  }

  componentDidMount() {
    fetch('https://api.pandascore.co/ow/leagues?&token=ib5ahXVcsVhUwxLKEggXfrDx9-78AZEYD37rfNGsxeEhQDpM8Ic')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }
 render(){
   return (
    <div className='home'>
      <div class="card">
            <div class="card-body">
              <h5 class="card-title">Steve Jobs</h5>
